function App() { 
  const { data, loading, error } = UseCustom('https://jsonplaceholder.typicode.com/todos/');

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
      <div className='App'> 
          <ul>
              {data.map(todo => (
                  <li key={todo.id}>{todo.title}</li>
              ))}
          </ul>
      </div>
  );
}
